const axios = require("axios")

const useFetch = (url) => {
  console.log(url)
  const options = {
    method: "GET",
    url: "https://avatar-by-name.p.rapidapi.com/",
    params: { name: "Benjamin" },
    headers: {
      "X-RapidAPI-Host": "avatar-by-name.p.rapidapi.com",
      "X-RapidAPI-Key": "a91001377dmsh68ce7e639bbfa61p1244adjsn8fb3a309b0b3",
    },
  }

  axios
    .request(options)
    .then(function (response) {
      console.log(response.data)
    })
    .catch(function (error) {
      console.error(error)
    })
}

export default useFetch
